import React from 'react';



const NavBar = (props) => {

	return (

			<div className={"items-center flex p-4"}>

				<div>{"Welcome, Beod"}</div>

				<div className={"bg-silver items-center flex justify-end grow"}>
					<div className={"bg-purple grid grid-cols-2 "}> 
						<input className={"mr-8"} value={'s'} type="text" name="search" id="search" />
						<div className={"grid grid-cols-2"}>
							<div className={"bg-silver"}>
							{"svg"}
							{"0 Planted"}
							</div>
							<div className={"grid grid-cols-2"}>
								<div>{"bell svg"}</div>
								<div className={"flex"}>
									<div></div>
									<div className={"grow"}>
									<span>ds</span><span>sd</span>
									</div>
									<div></div>
								</div>
							</div>
						</div>

					</div>
				</div>

			</div>
		);
}

export default NavBar;
